sources.scss\\_mixins.scss:
@mixin hyperlink {
    a{
        text-transform: uppercase;
        vertical-align: baseline;
        text-decoration: none;
        color: $color1;
        font-size: 14px;

        &:hover {
            color: $color2;
        };
    };
};

@mixin grayBtn {
    button {
        background: none;
        border: 1px solid $color1;
        border-radius: 5px;
        font-family: $font3;
        font-size: $fsize3;
        color: $color1;
        font-weight: bold;
        text-transform: uppercase;
        width: 120px;
        height: 40px;

        &:hover {
            background: $color1;
            color: $color3;
        }
    }
}

@mixin greenBtn {
    button{
        background: $color2;
        width: 90px;
        height: 60px;
        border-radius: 6px;
        border: 0;
        text-transform: uppercase;
        vertical-align: baseline;
        color: $color3;
        font-size: $fsize2;
        font-weight: 600;
        font-family: inherit;
    };
};

@mixin imageHyper {
    a {
        display: flex;
        justify-content: flex-end;
        flex-direction: column;
        padding: 10px;
        flex: 1;
        border: 0px solid;
        text-decoration: none;
        color: $color3;
        font-size: $fsize3;
        font-family: $font2;
       
        h3 {
            margin: 0;
            text-transform: uppercase;
        }

        
        &:hover {
            z-index: 100;
            transition: transform .2s;
            transform: scale(1.1);
        }
    }
}

